import { listProduct } from "../functions/product";


const Shop = () => {
    const [product, setProduct] = useState([]);
    const [loading, setLoading] = useState(false);


    useEffect(() => {
        //code
        loadData();
    }, []);


    const loadData = () => {
        setLoading(true);
        //code
        listProduct(2)
            .then((res) => {
                setProduct(res.data);
                setLoading(false);
            }).catch((err) => {
                setLoading(false);
                console.log(err);
            });
    };


    return (
        <div>shop</div>
    )
}

